import {useState} from 'react'
export default function MyBody(){
    const [name,setname]=useState('ידגחיגיגיגע')
    
    return <p>
        {name}
        שלום וברכה
        <input onChange={(e)=>setname(e.target.value)} placeholder="הכנס שם"></input>
        <Calc></Calc>
    </p>
}
 function Calc(){
    return <p>{3+8}</p>
}
